    "2016-01-02T13:22:54.415227",nt"name": "establishment-of-a-nesting-gadwall-population-at-iroquois-national-wildlife-refuge-progres-fee4d",nt"isopen":
    false,nt"url": null,nt"notes": "The main goal of the project is to establish
    a nesting population of gadwalls on the Iroquois National Wildlife Refuge by capturing
    ducklings by night lighting on Montezuma National Wildlife Refuge and releasing
    them on Iroquois National Wildlife Refuge. It was apparent that the late start of
    the capture operations for the second consecutive year was the major handicap in
    the success of the project. Also it is evident that the numbers of ducklings transferred
    per year to date have been so small that there is slight chance of success in establishing
    a nesting gadwall population.",nt"license_title": "License Not Specified",nt"extras":
